import {
    appbarHeight
} from '../../masterStyle.js';

const goldenRatio = 1.61803398875;

const gymStyle = theme => ({
    container: {
        height: "100%",
        [theme.breakpoints.up('sm')]: {
            marginLeft: theme.spacing(5),
            marginRight: theme.spacing(5),
            marginTop: theme.spacing(5),
            width: "inherit",
            height: "90vh"
        }
    },
    title: {
        padding: "1.5rem"
    },
});

export default gymStyle;
